    //   })
    //   .catch((err) => alert("SVG 加載失敗:", err));
    this.loadImages();
  },
  mounted() {
    setTimeout(() => {
      this.showOverlay = false;
    }, 7000);
  },
  methods: {
    toggleClickEffect() {
      const clickSvgElement = document.querySelector(".click-svg");
      if (clickSvgElement) {
        clickSvgElement.style.animationDelay = "0s";
        clickSvgElement.classList.add("clicked");

        setTimeout(() => {
          clickSvgElement.classList.remove("clicked");
        }, 1000);
      }
    },
    loadImages() {
      const requireContext = require.context(
        "@/assets/images/SHG",
        false,
        /\.(png|jpe?g|svg)$/
      );

      // 加載圖片並生成圖片清單
      this.images = requireContext.keys().map((key) => {
        const fileName = key.replace("./", ""); // 提取圖片名稱
        return {
          src: requireContext(key), // 圖片完整路徑
          name: fileName, // 圖片名稱
        };
      });
    },
    openModal() {
      if (this.images.length === 0) {
        alert("目前沒有可用圖片！");
        return;
      }
      this.toggleClickEffect();
      this.isModalOpen = true;
      setTimeout(() => {
        document.querySelector(".modal-overlay").classList.add("open");
      }, 10); // 微小延遲以確保類名切換生效
      document.body.classList.add("no-scroll");

      // 隨機選取圖片
      const randomIndex = Math.floor(Math.random() * this.images.length);
      const selected = this.images[randomIndex];

      // 查找對應的 URL
      const link = this.imageUrlMap[selected.name] || "#"; // 若無對應 URL，設置為占位符
      this.selectedImage = {
        ...selected,
        link, // 增加對應 URL
      };

      this.isModalOpen = true; // 開啟模態框
    },
    closeModal() {
      const overlay = document.querySelector(".modal-overlay");
      overlay.classList.remove("open");

      setTimeout(() => {
        this.isModalOpen = false;
      }, 300);
    },
  },
};
</script>

